import Add from "../pages/Add"
import Update from "../pages/Update"

function App() {
  return (
 <Router>
    <Routes>
        <Route element={<Books/>} path="/"></Route>
        <Route element={<Add/>} path="/add"></Route>
        <Route element={<Add/>} path="/add"></Route>
   
    </Routes>
 </Router>
  )
}

export default App
